  false,\n\t\"url\": null,\n\t\"notes\": \"With less than 7% of historic oak woodland
  habitat and 1% of oak savanna currently remaining in the Willamette Valley, the
  WV NWRC holds some of the largest and best examples of Oregon white oak habitat
  remaining in the Valley. Over 150 years of fire suppression has allowed the succession
  of oak savannas and prairies into dense oak woodlands and Douglas-fir dominated
  conifer forests. The proposed project builds off of previous successes from Invasive
  Species Control Program (ISCP) proposals.Through ISCP funding, approximately 20
  acres of oak woodland was treated on Baskett Sloughu2019s North Butte in 2015. Our
  goal is to completely remove all fir from oak habitats on Baskett Slough by 2020,
  largely thanks to ISCP funding. Phase III aims to: 1) hand-cut all fir from a 34
  acre woodland (~100 trees/acre, less than 6u201d dbh), 2) girdle/snag all remaining
  large isolated trees on south butte (~40 large trees), and 3) mechanically consolidate
  burn piles and slash clean-up from 2015 logging. Patches of large fir were logged
  in the 34 acre woodland in 2015, yet many small trees remain so we plan to hire
  a contracted hand crew to systematically grid and cut fir. These trees will be left
  on the ground and may be piled during future oak thinning management activities;
  however they are relatively small in biomass. The majority of remaining large fir
  will be girdled as it would need to be helicopter logged and does not warrant the
  cost. All piles were burned in fall of 2015, however consumption was less than 75%
  and we plan to consolidate piles with a skid steer, further clean slash, and finish
  pile burning. Following implementation of this project, only 20 acres of mature
  fir that is overtopping oaks will remain and be treated by 2020.\",\n\t\"owner_org\":
